import React, { Component } from 'react';
import AddFunds from '../../Components/Add/add.js'
import Balance from '../../Components/Balance/balance.js'
import Stock from '../../Components/Stock/stock.js'


class Account extends Component {

  componentDidMount(){
    //obtain account info - name, stocks

  }

    render() {

      var stocks = [];

      for(var stock in this.state.stocks){
        stocks.push(<Stock value = {stock}/>)
      }
      return (
        <div className="homepage">

          <Balance balance={2000}/>

          <AddFunds/>

          {stocks}

          <button>CANCEL_BUY</button>


          CANCEL_SELL

          SELL

          COMMIT_SELL

          CANCEL_SET_BUY

          CANCEL_SET_SELL

          DUMPLOG

          DISPLAY_SUMMARY

          SET_SELL_AMOUNT

          SET_SELL_TRIGGER

        </div>
      );
    }
  }

  export default Account;
